package main.java.command;

import main.java.util.EmojiUtil;
import net.dv8tion.jda.api.EmbedBuilder;
import net.dv8tion.jda.api.events.message.guild.GuildMessageReceivedEvent;
import net.dv8tion.jda.api.hooks.ListenerAdapter;
import org.jetbrains.annotations.NotNull;

public class BlockCommand extends ListenerAdapter {

    @Override
    public void onGuildMessageReceived(@NotNull GuildMessageReceivedEvent event) {
        super.onGuildMessageReceived(event);
        String message = event.getMessage().getContentRaw();
        if (message.equalsIgnoreCase("block") || message.equalsIgnoreCase("Block")) {
            EmbedBuilder helpBlock = new EmbedBuilder();
            helpBlock.setTitle("原之序 | ORDERLY SERVER");
            helpBlock.setFooter("新手 XinShou");
            helpBlock.addField(EmojiUtil.no1.getAsMention() + " 初衷", "以紀律為核心發展的伺服器，希望每位成員可以共同帶動伺服器發展", false);
            helpBlock.addField(EmojiUtil.partner.getAsMention() + " 憧憬", "成員們可以在此平等的交流，有任何問題都可以互相幫助", false);
            helpBlock.addField(EmojiUtil.discord.getAsMention() + " 加入方式",
                    EmojiUtil.dot4.getAsMention() + "" +
                            "邀請者要為被邀請的成員之行為負責並持續 1 個月\n" +
                            EmojiUtil.guildDot7.getAsMention() + "" +
                            "加入時，需輸入正確的**二字中文暱稱**與 **Minecraft / English 名字**\n" +
                            EmojiUtil.redDot.getAsMention() + "" +
                            "必須詳閱並同意規則與注意事項，如有疑慮，隨時可向管理員反應", false);
            helpBlock.addBlankField(false);
            helpBlock.addField(EmojiUtil.minecraftgrassblock.getAsMention() + " 此為暫定公告，尚未正式開放！","目前伺服器尚在籌備中，有意願加入的玩家可以在此等待，感謝您",false);
            helpBlock.setColor(0X00FFFF);
            helpBlock.setTimestamp(event.getMessage().getTimeCreated());
            event.getChannel().sendMessage(helpBlock.build()).queue();
        }
    }

}
